import 'dart:convert';

import 'package:flutter/material.dart';
import 'package:flutter/services.dart';
import 'package:flutter_svg/flutter_svg.dart';

class KpImage extends StatelessWidget {
  const KpImage.base64(
    this.source, {
    this.fit,
    this.width,
    this.height,
    super.key,
  }) : imageType = ImageType.base64;

  const KpImage.asset(
    this.source, {
    this.fit,
    this.width,
    this.height,
    super.key,
  }) : imageType = ImageType.asset;

  const KpImage.network(
    this.source, {
    this.fit,
    this.width,
    this.height,
    super.key,
  }) : imageType = ImageType.network;

  const KpImage.svg(
    this.source, {
    this.fit,
    this.width,
    this.height,
    super.key,
  }) : imageType = ImageType.svg;
  final String source;
  final ImageType imageType;
  final BoxFit? fit;
  final double? width;
  final double? height;

  @override
  Widget build(BuildContext context) {
    if (imageType == ImageType.network) {
      if (source.contains('.png') || source.contains('.jpg')) {
        precacheImage(NetworkImage(source), context);
      }
    }

    switch (imageType) {
      case ImageType.asset:
        return Image.asset(
          source,
          fit: fit,
          width: width,
          height: height,
          errorBuilder: (context, error, stackTrace) =>
              const KpImage.base64('base64Mock'),
        );
      case ImageType.network:
        return Image.network(
          source,
          fit: fit,
          width: width,
          height: height,
          errorBuilder: (context, error, stackTrace) =>
              const KpImage.base64(base64Mock),
          loadingBuilder: (context, child, loadingProgress) {
            if (loadingProgress == null) {
              return child;
            }
            return const CircularProgressIndicator.adaptive();
          },
        );
      case ImageType.svg:
        return SvgPicture.asset(
          source,
          fit: fit ?? BoxFit.contain,
          width: width,
          height: height,
          placeholderBuilder: (context) =>
              const CircularProgressIndicator.adaptive(),
        );
      case ImageType.base64:
        return Image.memory(
          _decodeBase64Image(source),
          fit: fit,
          width: width,
          height: height,
        );
      default:
        throw UnimplementedError('Unknown image type');
    }
  }

  Uint8List _decodeBase64Image(String base64String) {
    return base64Decode(base64String);
  }
}

enum ImageType { asset, network, svg, base64 }

const base64Mock =
    'data:image/jpeg;base64,';
